"""
Program: fixoverlapping.py: This will open a dialog box with a button, when clicked it will ask for selecting two closed polylines in the current document opened in AutoCAD/CIVIL3D, after run completion, the result will be such that the firstly selected polyline will be trimmed at the point of intersection if they do so and it will follow the same path as of the other for that particular intersection length thereby resolving the overlapping.
Author: Suman Kumar -> github.com/BHUTUU/AutocadWork
Date: 22 DECEMBER 2025 
"""
import base64
import os
import tempfile
import win32com.client
import pythoncom
import sys
from shapely.geometry import Polygon
from tkinter import Tk, Button, Label
pythoncom.CoInitialize()
def run_fix_overlapping():
    acad = win32com.client.Dispatch("AutoCAD.Application")
    doc = acad.ActiveDocument
    ms = doc.ModelSpace
    try:
        doc.SelectionSets.Item("PYSEL").Delete()
    except Exception:
        pass
    ss = doc.SelectionSets.Add("PYSEL")
    ss.SelectOnScreen()
    while True:
        try:
            number_of_selection=len([i for i in ss])
            break
        except Exception:
            continue
    POLYLINES=[]
    if number_of_selection == 2:
        for obj in ss:
            while True:
                try:
                    if obj.ObjectName == "AcDbPolyline" and obj.Closed:
                        POLYLINES.append(obj)
                    else:
                        doc.SendCommand('(alert "Selected objects must be closed polylines!" ) ')
                        return #sys.exit(1)
                    break
                except Exception:
                    continue
    else:
        doc.SendCommand('(alert "There must be at least and not more than 2 Closed polylines!" ) ')
        return #sys.exit(1)
    vertices_of_pl1 = POLYLINES[0].Coordinates
    vertices_of_pl2 = POLYLINES[1].Coordinates
    points_of_pl1 = [(vertices_of_pl1[i], vertices_of_pl1[i+1]) for i in range(0, len(vertices_of_pl1), 2)]
    points_of_pl2 = [(vertices_of_pl2[i], vertices_of_pl2[i+1]) for i in range(0, len(vertices_of_pl2), 2)]
    poly1 = Polygon(points_of_pl1)
    poly2 = Polygon(points_of_pl2)
    result = poly1.difference(poly2)
    points_of_new_poly1 = []
    for x,y in result.exterior.coords:
        points_of_new_poly1.append(x)
        points_of_new_poly1.append(y)
    points_var = win32com.client.VARIANT(pythoncom.VT_ARRAY | pythoncom.VT_R8, points_of_new_poly1)
    while True:
        try:
            new_pline_created=ms.AddLightWeightPolyline(points_var)
            new_pline_created.Closed = True
            POLYLINES[0].Erase()
            break
        except Exception:
            continue
icon_base64=b''
icon_bytes = base64.b64decode(icon_base64)
icon_path = os.path.join(tempfile.gettempdir(), "fixoverlapping.ico")
with open(icon_path, "wb") as f:
    f.write(icon_bytes)
window = Tk()
window.title("FixOverlappingOfClosedPolylines")
window.geometry("350x130")
window.minsize(350, 130)
window.maxsize(350, 130)
window.iconbitmap(icon_path)
os.remove(icon_path)
window.attributes("-topmost", True)
runBtn = Button(window, text="RUN", font=("Arial", "20", "bold"), borderwidth=10, height=2, width=30, command=run_fix_overlapping, bg="grey")
runBtn.pack()
dev_label = Label(window, anchor="w" ,text="By: Suman Kumar    ----    github.com/BHUTUU/Autocadwork", font=("Arial", "8", "bold"))
dev_label.pack(side="bottom", fill="x")
window.mainloop()